import React, { useState } from 'react';
import { BrowserRouter as Router, Routes, Route, Navigate, Link, useLocation } from 'react-router-dom';
import Login from './components/Login';
import Register from './components/Register';
import TransportDashboard from './components/TransportDashboard';
import TariffManagement from './components/TariffManagement';
import PqrsForm from './components/PqrsForm';
import PqrsList from './components/PqrsList';
import DriverInfo from './components/DriverInfo';
import BusInfo from './components/BusInfo';
import { login, register, logout } from './services/authService';

const NavigationMenu = () => {
  const location = useLocation();

  const menuItems = [
    {
      title: 'Rutas',
      path: '/routes',
      icon: 'üöå'
    },
    {
      title: 'Tarifas',
      path: '/tariffs',
      icon: 'üí∞'
    },
    {
      title: 'PQRS',
      path: '/pqrs',
      icon: 'üìù'
    },
    {
      title: 'Buses',
      path: '/buses',
      icon: 'üöç'
    },
    {
      title: 'Conductores',
      path: '/drivers',
      icon: 'üë®‚Äç‚úàÔ∏è'
    }
  ];

  return (
    <nav className="bg-white shadow mb-8">
      <div className="max-w-7xl mx-auto px-4">
        <div className="flex justify-between h-16">
          <div className="flex space-x-8">
            {menuItems.map((item) => (
              <Link
                key={item.path}
                to={item.path}
                className={`inline-flex items-center px-1 pt-1 border-b-2 text-sm font-medium ${
                  location.pathname === item.path
                    ? 'border-blue-500 text-gray-900'
                    : 'border-transparent text-gray-500 hover:border-gray-300 hover:text-gray-700'
                }`}
              >
                <span className="mr-2">{item.icon}</span>
                {item.title}
              </Link>
            ))}
          </div>
        </div>
      </div>
    </nav>
  );
};

function App() {
  const [user, setUser] = useState(null);
  const [error, setError] = useState('');

  const handleLogin = async (email, password) => {
    try {
      const userData = await login(email, password);
      setUser(userData);
      setError('');
    } catch (err) {
      setError('Credenciales inv√°lidas');
    }
  };

  const handleRegister = async (userData) => {
    try {
      const newUser = await register(userData);
      setUser(newUser);
      setError('');
    } catch (err) {
      setError('Error al registrar usuario');
    }
  };

  const handleLogout = () => {
    logout();
    setUser(null);
  };

  if (!user) {
    return (
      <Router>
        <div className="min-h-screen bg-gray-100">
          <Routes>
            <Route path="/register" element={<Register onRegister={handleRegister} error={error} />} />
            <Route path="*" element={<Login onLogin={handleLogin} error={error} />} />
          </Routes>
        </div>
      </Router>
    );
  }

  return (
    <Router>
      <div className="min-h-screen bg-gray-100">
        <div className="bg-white shadow">
          <div className="max-w-7xl mx-auto px-4 py-4">
            <div className="flex justify-between items-center">
              <h1 className="text-2xl font-bold">Bienvenido, {user.name}</h1>
              <button
                onClick={handleLogout}
                className="bg-red-500 text-white px-4 py-2 rounded hover:bg-red-600"
              >
                Cerrar Sesi√≥n
              </button>
            </div>
          </div>
        </div>

        <NavigationMenu />

        <div className="max-w-7xl mx-auto px-4 py-6">
          <Routes>
            <Route path="/" element={<Navigate to="/routes" replace />} />
            <Route path="/routes" element={<TransportDashboard />} />
            <Route path="/tariffs" element={<TariffManagement />} />
            <Route path="/pqrs" element={
              <div className="space-y-8">
                <PqrsForm onSubmit={(data) => console.log('PQRS submitted:', data)} />
                <PqrsList pqrs={[]} />
              </div>
            } />
            <Route path="/buses" element={<BusInfo buses={[]} />} />
            <Route path="/drivers" element={<DriverInfo drivers={[]} />} />
          </Routes>
        </div>
      </div>
    </Router>
  );
}

export default App;

